import axios from "axios";

export default function GetClass(){
    const[classId, setClassId] = useState([]);
    

    useEffect(()=>{
        function getClassID() {
            axios.get("http://localhost:8070/class/get/${id}").then((res)=>{
               setClassId(res.data);
               console.log(res);
        }).catch((err)=>{
            alert(err.message);
        })
        }
        getClassId();
    } ) 
    return(
        <div className="container">
            <h1>Class</h1>
            <br></br>
            <div>
            <table class="table">
                <thead>
                    <tr>
                        <th scope="col">no</th>
                        <th scope="col">class</th>
                        <th scope="col">garde</th>
                        <th scope="col">date</th>
                        <th scope="col">time</th>
                        <th scope="col">link</th>
                        <th scope="col"></th>
                    </tr>
                </thead>
                <tbody>
                {classId.map((classId, index) => {
                    return(
                    <tr key={index}>
                        <th scoop="row">{index+1}</th>
                        <td>{classId.classname}</td> 
                        <td>{classId.grade}</td>
                        <td>{classId.date}</td>
                        <td>{classId.time}</td>
                        <td>{classId.link}</td>
                    </tr>
                    )
                    
                
                
               
            })}

                </tbody>
            </table>
            

            
        </div>
        </div>
    )
    
}
